import React from 'react';

import '../App.css';
import InfoRight from './InfoRight';
import {Row,Col,Grid} from 'react-bootstrap';

class ContentInfoUser extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
        content: [],
    }
    this.buildProfile = this.buildProfile.bind(this);
    this.buildOrder = this.buildOrder.bind(this);
    this.buildProfile = this.buildProfile.bind(this);
  }


    render() {
        return (
            <div>
              <Grid>
                <Row>
                    <Col lg={3} md={2} sm={1} xs={1}></Col>
                    <Col lg={6} md={8} sm={10}><h1 className="title-page"><b>MANAGEMENT ACCOUNT</b></h1></Col>
                    <Col lg={3} md={2} sm={1} xs={1}></Col>
                </Row>
                <Row className={'my-row contentPage'}>
                  <Col lg={3} md={3} sm={4} >
                    <ul className="account-info-general navi" id="account-direct">
                        <li><strong>My Account</strong></li>
                        <li><a onClick={this.buildProfile}>My Profile</a></li>
                        <li><a href="/myOrder">My Order</a></li>
                        <li><a href="/addressBook">Address Book</a></li>
                    </ul>
                  </Col>
                  <Col lg={9} md={9} sm={8} xs={10} xsPush={1} smPush={0}>
                    <InfoRight></InfoRight>
                  </Col>
                </Row>
              </Grid>
            </div>
        );
    }
}

export default ContentInfoUser;
